\parbox{3.5in}{For convenience, the unit load is chosen in the same 
direction we assumed for $R_b$.
This establishes {\bf upward} displacements as being positive.}

\parbox{3.5in}{This integral is not in the main part of the table, so we must
use the most general case with $m_0=8$, $m_1=0$, $M_0=-720$, $M_1=-80$
and $w=10$.}

\[
\begin{split}
M_a &= M_{a0} - m_{a1} R_b = 720 - 8\times85 = 40\,\mathrm{kN\,m}\\
R_a &= R_{a1} - r_{a1} R_b = 120 - 1\times 85 = 25\,\mathrm{kN}\\
\end{split}
\]
